import React from "react";
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import "./KeyItem.css";

const KeyItem = (props) => {
    console.log(props);
    return (
        <Box id="KeyItem">
            <Grid container>
                <Grid item xs={4}>
                    <div className="Circle"></div>
                </Grid>
                <Grid item xs={8}>
                    <p>{props.value}</p>
                </Grid>
            </Grid>
        </Box>
    )
}

export default KeyItem;
